namespace a {
//application/octet-stream
function random_string($length = 15)
{   
$times=ceil($length/32);
 
$random='';
while ($times>0)
{
$random.=md5(uniqid(rand(), true));
$times--;
}
 
return substr($random, 0, $length);
}
